        description = "Evasion bypass patterns targeting call sequences"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 0F 84 ?? ?? ?? ?? 8B CE E8 }
        $pattern1 = { 6A ?? 5A 8B CE E8 74 12 ?? 0F 84 33 FD ?? }
        $pattern2 = { FF C8 FF FF FF 8B CE E8 0F 84 33 FD FF FF ?? }

    condition:
        any of them
}
